          <img className="rightbarProfileImg" src="/assests/dan.jpg" alt="" />
           <span className='rightbarUserName'> Dan Walker</span>
           <span className='postTime'> 1 hour ago</span>
      </div>
     </div>
    </div>
  );
}

export default Rightbar;
